Something like this queries features for all sites:
```jsx
import { useSelector } from 'react-redux';
import QuerySiteFeatures from 'calypso/components/data/query-site-features';
import getSites from 'calypso/state/selectors/get-sites';

export default function QueryAllSiteFeatures() {
	const sites = useSelector( getSites );
	const allSiteIds = sites.map( ( site ) => site.ID );
	return <QuerySiteFeatures siteIds={ allSiteIds } />;
}

// <QueryAllSiteFeatures />
```
Unfortunately, it kicks off one HTTP request per site, which makes for 100+ requests for me, since I have so many sites:
![2022-05-18_14-30](https://user-images.githubusercontent.com/937354/169141062-0d09fb6a-9f32-4427-b83c-ee51d5d98557.png)

**Ideas**:
* Modify sites endpoint to return features
* Modify features endpoint to allow multiple sites to be queried in one request; strategically use `<QueryAllSiteFeatures>` in files like `client/me/help/help-contact/index.jsx`†
* Modify features endpoint to add a "return all features for all my sites" function without having to specify siteids; strategically use `<QueryAllSiteFeatures>`
* Make a new API endpoint that calculates the support level and returns that value without having to send all the features to calypso
* Other?

----

†_I see these files as needing access to the 'features for all sites' data:_

- `client/me/help/help-contact/index.jsx`
- `client/blocks/inline-help/inline-help-contact-view.jsx`
- `client/components/marketing-survey/cancel-purchase-form/index.jsx`
- `client/my-sites/checkout/composite-checkout/components/checkout-help-link.tsx`
